import { Dispatch, SetStateAction } from "react";
import Vehicle from "./vehicle";
import { Product } from "./domain/product";
import { Model } from "./domain/model";
import { Cat } from "./domain/cat";
import { Manufacturer } from "./domain/manufacturer";
import { Meta } from "./domain/meta";
const geo_flag =
  "data:image/png;base64,";

export interface IVehicleContainerProps {
  product_lst: Product[];
  models: Model[];
  cat_lst: Cat[];
  manufacturers: Manufacturer[];
  page: number;
  addpagetolist: Function;
  handlePageChange(newPage: number): void;
  isusd:boolean;
}

export default function Vehicle_container({
  product_lst,
  models,
  cat_lst,
  manufacturers,
  page,
  handlePageChange,
  isusd
}: IVehicleContainerProps) {
  return (
    <div className="vehicle_container">
      {product_lst.map((prod) => {
        const piclink =
          "https://static.my.ge/myauto/photos/" +
          prod.photo +
          "/thumbs/" +
          prod.car_id +"_1.jpg?v=" +prod.photo_ver;
        // const price_checker = prod.has_predicted_price
        //   ? Math.round(prod.predicted_price)
        //   : prod.price_value;
        // const price = price_checker === 0 ? prod.price_value : price_checker;
        const price = (isusd ? prod.price_usd : prod.price_value)
        const release_year = String(prod.prod_year);
        const distance = String(prod.car_run_km);
        const engine_vol = String(prod.engine_volume / 1000);
        const goodcond = prod.conditioner? prod.condition_type_id === 0? false: true: false;
        const side = prod.right_wheel ? "მარჯვნივ" : "მარცხნივ";
        const manufac = manufacturers?.find((obj) => obj.man_id === String(prod.man_id));
        const name_extension1 = models?.find((obj) => obj.model_id === prod.model_id);
        const name_extension2 = cat_lst?.find((obj) => obj.category_id === prod.category_id);
        const namee = manufac?.man_name + "  " +(name_extension1 ? name_extension1.model_name : "") +(name_extension2 ? name_extension2.seo_title : "");

        return (
          <Vehicle
            image={piclink}
            name={String(namee)}
            release_year={release_year}
            engine={engine_vol + " dat. hybridao"}
            distance={distance + " km"}
            type={"automatic"}
            side={side}
            price={price}
            location={"samargalo"}
            gambajebadi={prod.customs_passed}
            flag={geo_flag}
            gambajeba_price={0}
            gambajebulia={false}
            views={prod.views}
            uploaded={"2 დღის წინ"}
            adds={""}
            vip={2}
            test_drive={true}
            isnew={true}
            cleanhistory={true}
            goodcond={goodcond}
            saswrafod={true}
            verified={true}
            isforrent={prod.for_rent}
          />
        );
      })}

      <div>
        <button onClick={() => handlePageChange(1)}>
          პირველ გვერდზე დაბრუნება
        </button>

        <div style={{ display: "flex" }}>
          <button onClick={() => handlePageChange(page - 1)}> &lt; </button>

          <h3>Page: {page}</h3>

          <button onClick={() => handlePageChange(page + 1)}> &gt; </button>
        </div>
      </div>
    </div>
  );
}
